ax.set_ylim([0, max(u[1], v[1], w[1])+1])
ax.set_zlim([0, max(u[2], v[2], w[2])+1])
ax.set_xlabel('X')
ax.set_ylabel('Y')
ax.set_zlabel('Z')
ax.legend()
plt.title('Visualización de Vectores en 3D')
plt.show()
